// src/pages/HomePage.js
import React from 'react';
import Slider from '../components/Slider';
import CardSection from '../components/CardSection';
import './HomePage.css';

const HomePage = () => {
  const categories = [
    { id: 1, name: 'Electronics', image: '/images/electronics.jpg' },
    { id: 2, name: 'Fashion', image: '/images/fashion.jpg' },
    { id: 3, name: 'Home & Garden', image: '/images/home-garden.jpg' },
    { id: 4, name: 'Sports', image: '/images/sports.jpg' },
    { id: 5, name: 'Toys', image: '/images/toys.jpg' },
    { id: 6, name: 'Automotive', image: '/images/automotive.jpg' },
    { id: 7, name: 'Beauty', image: '/images/beauty.jpg' },
    { id: 8, name: 'Books', image: '/images/books.jpg' },
  ];

  return (
    <div className="home-page">
      <Slider />
      <CardSection heading="Best Sellers" link="/best-sellers" />
      <CardSection heading="New Sellers" link="/new-sellers" />
      <div className="categories-section">
        {categories.map((category) => (
          <div key={category.id} className="category-card">
            <img src={category.image} alt={category.name} />
            <h3>{category.name}</h3>
            <p>Shop Now</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default HomePage;
